import React from "react";
import { useForm } from "react-hook-form";
import axios from "axios";

import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";

const validationSchema = yup.object().shape({
  name: yup.string().required("Name is required"),
  age: yup.number().required("Age is required"),
  sex: yup.string().required("Sex is required"),
  mobile: yup.string().matches(/^[6-9]\d{9}$/, "Invalid Indian mobile number"),
  emergencyContact: yup
    .string()
    .matches(/^[6-9]\d{9}$/, "Invalid Indian mobile number"),
  idType: yup.string().required("ID Type is required"),
  govtId: yup.string().when("idType", {
    is: "Aadhar",
    then: yup.string().matches(/^\d{12}$/, "Invalid Aadhar number"),
    otherwise: yup
      .string()
      .matches(/^[A-Za-z]{5}\d{4}[A-Za-z]{1}$/, "Invalid PAN number"),
  }),
});

function UserRegistrationForm() {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(validationSchema)}
  );

  const onSubmit = (data) => {
    axios
      .post("http://localhost:4000/api/users", data)
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.error(err);
      });
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <div>
        <label>Name</label>
        <input
          type="text"
          name="name"
          {...register("name", { required: true })}
        />
        {errors.name && <p>{errors.name.message}</p>}
      </div>

      <div>
        <label>Age</label>
        <input
          type="number"
          name="age"
          {...register("age", { required: true })}
        />
        {errors.age && <p>{errors.age.message}</p>}
      </div>

      <div>
        <label>Sex</label>
        <input
          type="text"
          name="sex"
          {...register("sex", { required: true })}
        />
        {errors.sex && <p>{errors.sex.message}</p>}
      </div>

      <div>
        <label>Mobile</label>
        <input
          type="text"
          name="mobile"
          {...register("mobile", { required: true })}
        />
        {errors.mobile && <p>{errors.mobile.message}</p>}
      </div>

      <div>
        <label>Emergency Contact Number</label>
        <input
          type="text"
          name="emergencyContact"
          {...register("meregencyContact", { required: true })}
        />
        {errors.emergencyContact && <p>{errors.emergencyContact.message}</p>}
      </div>

      <div>
        <label>ID Type</label>
        <select name="idType" {...register("idType", { required: true })}>
          <option value="">Select ID Type</option>
          <option value="Aadhar">Aadhar</option>
          <option value="PAN">PAN</option>
        </select>
        {errors.idType && <p>{errors.idType.message}</p>}
      </div>

      <div>
        <label>Govt Issued ID</label>
        <input
          type="text"
          name="govtId"
          {...register("govtID", { required: true })}
        />
        {errors.govtId && <p>{errors.govtId.message}</p>}
      </div>

      <button type="submit">Submit</button>
    </form>
  );
}

export default UserRegistrationForm;
